import React from "react";
import MessageCard from "./messagecard";

class MessageList extends React.Component {
  render() {
    return <MessageCard message={`eae man`} />;
    return <MessageCard message={`eae lok`} />;
    return <MessageCard message={`blz?`} />;
    return <MessageCard message={`blz e vc`} />;
    return <MessageCard message={`sereno`} />;
  }
}

export default MessageList;
